module.exports = /*#__PURE__*/JSON.parse('{"title":"CT剂量测量","description":"本页面介绍CT中的剂量测量方法、患者大小对剂量的影响以及剂量减少技术。","sections":[{"id":"dose-measures","title":"不同剂量测量方法","description":"剂量代表从辐射中沉积在组织中的能量与组织质量的比值，以J/kg = Gray (Gy)为单位。","content":"我们需要首先解释什么是剂量，为什么我们关心它，以及有哪些不同的测量方法。剂量代表从辐射中沉积在组织中的能量与组织质量的比值，以J/kg = Gray (Gy)为单位。请注意，因为它是每单位质量的能量，所以在1kg的脚中沉积1焦耳的能量与在腹部（重约15kg）沉积15焦耳的能量是相同的剂量。","illustrations":[{"type":"diagram","description":"剂量示意图","caption":"左图：1Gy剂量，1J能量；右图：1Gy剂量，9J能量。每个方块代表1kg组织。"}],"keyPoints":["剂量是每单位质量组织中沉积的能量（J/kg = Gy）","辐射的不良后果有两种类型：确定性效应和随机效应","确定性效应与单个细胞接收的辐射量直接相关","随机效应可以在很小的剂量下随机发生","有效剂量（单位为Sv）考虑了不同组织的辐射敏感性"]},{"id":"ct-dose-measurement","title":"CT中的剂量测量","description":"CT剂量指数（CTDI）是测量CT中剂量的标准方法，代表对人体一个切片的辐射量。","content":"回到剂量——组织中沉积的能量与组织质量的比值——我们需要弄清楚如何在CT中测量它。记住，CT基本上是在身体的一段长度上从不同角度拍摄大量X射线。我们不能简单地加起来\\"每个X射线\\"。为了测量CT中的剂量，发明了CT剂量指数（CTDI）。CTDI，通常写作CTDI100，是在长时间CT扫描中对身体一个切片的辐射量。","keyPoints":["CTDI是测量CT中剂量的标准方法","CTDI代表对人体一个切片的辐射量","CTDIvol = CTDIw / 螺距，螺距越大，剂量越低","剂量长度乘积（DLP）= CTDIvol * 扫描长度，代表总辐射沉积"]},{"id":"bowtie-filter","title":"蝴蝶滤波器与剂量","description":"蝴蝶滤波器是一种特殊形状的滤波器，用于均衡人体不同部位接收的辐射剂量。","content":"在CT扫描中，X射线管围绕患者旋转，但患者的横截面通常不是圆形的。例如，在腹部扫描中，从侧面看患者比从前后看要\\"厚\\"。这意味着如果我们使用均匀的X射线束，侧面会接收更多的辐射（因为它必须穿过更多的组织）。为了解决这个问题，CT扫描仪使用所谓的\\"蝴蝶滤波器\\"。","illustrations":[{"type":"diagram","description":"蝴蝶滤波器示意图","caption":"蝴蝶滤波器的形状使得穿过患者侧面的X射线比穿过前后的X射线更强。"}],"keyPoints":["蝴蝶滤波器用于均衡不同方向的辐射剂量","它的形状使得穿过患者侧面的X射线比穿过前后的X射线更强","这有助于减少总体辐射剂量并提高图像质量"]},{"id":"patient-size","title":"患者大小与剂量","description":"患者大小对CT剂量有显著影响，较大的患者需要更高的辐射剂量才能获得相同质量的图像。","content":"患者大小对CT剂量有显著影响。较大的患者需要更高的辐射剂量才能获得相同质量的图像，因为X射线必须穿过更多的组织。现代CT扫描仪使用自动管电流调制技术（如西门子的CAREDose或GE的Auto mA）来根据患者大小自动调整辐射剂量。","keyPoints":["较大的患者需要更高的辐射剂量才能获得相同质量的图像","自动管电流调制技术可以根据患者大小自动调整辐射剂量","对于儿科患者，应特别注意减少辐射剂量"]},{"id":"dose-reduction","title":"剂量减少","description":"有多种技术可以减少CT扫描中的辐射剂量，包括迭代重建、管电流调制和低剂量协议。","content":"减少CT辐射剂量的方法有很多。最简单的方法是减少管电流（mA）或管电压（kV）。然而，这会导致图像噪声增加，可能影响诊断质量。现代CT扫描仪使用多种技术来在保持图像质量的同时减少辐射剂量，包括迭代重建、管电流调制和低剂量协议。","keyPoints":["减少管电流（mA）或管电压（kV）可以减少辐射剂量，但会增加图像噪声","迭代重建技术可以在低剂量下提高图像质量","管电流调制可以根据患者解剖结构自动调整辐射剂量","低剂量协议针对特定临床情况优化扫描参数"]}]}');

